description:
Bound by Magick #1-4 Lauren Dane


Format: mobi/epub
Genre: Paranormal Romance
Date: 1 November 2011 - 5 November 2013

Bound By Magick is a paranormal romance series set in a contemporary world where some Others are out to humans but many aren't - though it's only a matter of time. The series is set in Seattle and within Clan Owen, a corporation of sorts run by witches, but also features shifters and other types of paranormal beings.


